import withImages from "next-images";

// Import images
import Bio from "../assets/imgs/past-papers/csec/small/pob.jpg";

const PastPapersPreview = props => (
  <div>
    <img src={withImages(Bio)} />
  </div>
);

export default PastPapersPreview;
